import React, { useState } from 'react'

function App (){

const[inputdata,SetInputdata]=useState({
  name:"",
  rollno:""
})



  function changehandle(e){
 SetInputdata({...inputdata,[e.target.value]:e.target.value})

  }




  return (


    <div className='App'>
    <input type ="text" name='name' value={inputdata.name} onChange={changehandle} placeholder="name" />
    <input type ="text" name='rollno' value={inputdata.rollno} onChange={changehandle} placeholder="class" />






    </div>
  )
  }

export default App;
